import React from "react";

export default function Login({ handleClick }) {
  return (
    <div>
      <header>
        <h1>Welcome to SOC News</h1>
      </header>
      <h2>Please Sign In</h2>
      <button onClick={() => handleClick()}>Sign In with Google</button>
    </div>
  );
}
